import { createTheme, makeStyles } from "@material-ui/core";

export default makeStyles(() => ({
  appBar: {
    borderRadius: 15,
    margin: '30px 0',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
  },
  typography: {
    fontFamily: 'Arial',
    color: 'rgba(0,183,255, 1)'
  },
  image: {
    marginLeft: '15px',
  },
}));
